package com.enjoyf.activity.bean.qyz;import com.enjoyf.framework.jdbc.bean.NotNullColumnBean;import java.util.ArrayList;import java.util.Date;import java.util.List;public class Game {    private String  gameId;    private String  profileId;    private String  gameLevel;    private Date createTime;    public String getGameId() {        return gameId;    }    public void setGameId(String gameId) {        this.gameId = gameId;    }    public String getProfileId() {        return profileId;    }    public void setProfileId(String profileId) {        this.profileId = profileId;    }    public String getGameLevel() {        return gameLevel;    }    public void setGameLevel(String gameLevel) {        this.gameLevel = gameLevel;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public List getNotNullColumnList(){  List columnList = new ArrayList();   if(gameId != null) {    NotNullColumnBean bean = new NotNullColumnBean();    bean.setColumnName("gameid");    bean.setObj(gameId);    columnList.add(bean);   }   if(profileId != null) {    NotNullColumnBean bean = new NotNullColumnBean();    bean.setColumnName("profileid");    bean.setObj(profileId);    columnList.add(bean);   }   if(gameLevel != null) {    NotNullColumnBean bean = new NotNullColumnBean();    bean.setColumnName("game_level");    bean.setObj(gameLevel);    columnList.add(bean);   }   if(createTime != null) {    NotNullColumnBean bean = new NotNullColumnBean();    bean.setColumnName("create_time");    bean.setObj(createTime);    columnList.add(bean);   }  return columnList;  } }